BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "states" (
	"state_name"	TEXT,
	"state_abbrev"	TEXT,
	"region"	TEXT,
	"division"	TEXT
);
CREATE TABLE IF NOT EXISTS "people" (
	"id_number"	INTEGER NOT NULL UNIQUE,
	"first_name"	TEXT,
	"last_name"	TEXT,
	"city"	TEXT,
	"state_code"	TEXT,
	"shirt_or_hat"	TEXT,
	"quiz_points"	INTEGER,
	"team"	TEXT,
	"signup"	TEXT,
	"age"	INTEGER,
	"company"	TEXT,
	PRIMARY KEY("id_number" AUTOINCREMENT)
);
COMMIT;
